### evalRPN 
from typing import *
def f_gold(tokens: List[str]) -> int:
    nums = []
    for t in tokens:
        if len(t) > 1 or t.isdigit():
            nums.append(int(t))
        else:
            if t == "+":
                nums[-2] += nums[-1]
            elif t == "-":
                nums[-2] -= nums[-1]
            elif t == "*":
                nums[-2] *= nums[-1]
            else:
                nums[-2] = int(nums[-2] / nums[-1])
            nums.pop()
    return nums[0]
```

