"use strict";

function evalRPN(tokens) {
    let nums = [];
    for (let t of tokens) {
        if (t.length > 1 || !isNaN(t)) {
            nums.push(parseInt(t));
        } else {
            if (t === "+") {
                nums[nums.length - 2] += nums[nums.length - 1];
            } else if (t === "-") {
                nums[nums.length - 2] -= nums[nums.length - 1];
            } else if (t === "*") {
                nums[nums.length - 2] *= nums[nums.length - 1];
            } else {
                nums[nums.length - 2] = parseInt(nums[nums.length - 2] / nums[nums.length - 1]);
            }
            nums.pop();
        }
    }
    return nums[0];
}
